    me.init = function() {
        parent.log('Running dashboard 2 page javascript');
        $(function() {
            me.chart_servers();
            me.map_status();
            me.table_alerts();
            me.chart_alerts();
            me.form_provision();
            me.coding();
            me.onclicks();
        });
        // setInterval(function() { me.chart_servers_update(); }, 5000);
    };
    
    me.chart_servers = function() {
        if (!window.chart_type) window.chart_type = "area";
        if (!window.chart_url) window.chart_url = 'assets/js/pages/data/metricdata1.json';
        var _chart;
        // d3.json(window.chart_url, function(data) {
            nv.addGraph(function() {
                if (window.chart_type == "line") {
                    _chart = nv.models.cumulativeLineChart()
            			.x(function(d) { return d[0]; })
            			.y(function(d) { return d[1]; })
                        .average(function(d) { return d.mean/100; })
            			.useInteractiveGuideline(true)
                        .color(theme_colours) // add theme colours
            			.showControls(false)
            			.showLegend(false)
            			.interpolate("cardinal")
            			.duration(500);
                } else if (window.chart_type == "area") {
                    _chart = nv.models.stackedAreaChart()
            			.x(function(d) { return d[0]; })
            			.y(function(d) { return d[1]; })
            			.useInteractiveGuideline(true)
                        .color(theme_colours) // add theme colours
            			.style('stream')
            			.showControls(true)
            			.showLegend(false)
            			.interpolate("cardinal")
            			.duration(500);
                }
                
                _chart.xAxis
    				.tickFormat(function(d) { return d3.time.format("%X")(new Date(d)); });
    			_chart.yAxis
    				.tickFormat(d3.format(",.3f"));

    		    d3.select("#chart_servers")
    			    .datum(metricdata1)
    			    .transition()
    			    .duration(500)
    			    .call(_chart);
    	        
        		if (window.chart_servers_resize === undefined) {
            		window.chart_servers_resize = nv.utils.windowResize(function(){ _chart.update(); });
        		}
        		window.chart_servers = _chart;
        		window.chart_servers_counter = 1;
        		nv.utils.windowResize(function(){ _chart.update(); });
        		return _chart;
    
            });
        // });
    };
    

    me.chart_servers_update = function() {
        if (window.chart_servers_counter == 1) {
            window.chart_servers_counter = 2;
            d3.select("#chart_servers")
				.datum(metricdata2)
				.transition()
				.duration(500)
				.call(window.chart_servers);
            // window.chart_url = '/assets/js/pages/data/metricdata2.json';
            me.chart_servers_changesummary(68);
        } else if (window.chart_servers_counter == 2) {
            window.chart_servers_counter = 3;
            d3.select("#chart_servers")
				.datum(metricdata3)
				.transition()
				.duration(500)
				.call(window.chart_servers);
            // window.chart_url = '/assets/js/pages/data/metricdata3.json';
            me.chart_servers_changesummary(84);
        } else {
            window.chart_servers_counter = 1;
            d3.select("#chart_servers")
				.datum(metricdata1)
				.transition()
				.duration(500)
				.call(window.chart_servers);
			// window.chart_url = '/assets/js/pages/data/metricdata1.json';
            me.chart_servers_changesummary(51);
        }
    	$.getJSON(window.chart_url, function (data) {
			d3.select("#chart_servers")
				.datum(data)
				.transition()
				.duration(500)
				.call(window.chart_servers);
    	});
		// nv.utils.windowResize(window.chart_servers.update);
    };

    
    me.chart_servers_changetype = function(type) {
        if (!type) return;
        window.chart_type = type;
        d3.selectAll("#chart_servers > *").remove();
        me.chart_servers();
    };
    
    
    me.chart_servers_changesummary = function(to) {
        var from = parseInt($('h3#server-summary').html());
        var count = new CountUp('server-summary', from, to, 0, 0.5, {suffix: '%'});
        count.start();
    };
    
    
