    me.chart_alerts = function() {
        var chart;
        nv.addGraph(function() {
            chart = nv.models.scatterChart()
                .showDistX(true)
                .showDistY(true)
                .duration(300)
                .color(theme_colours);
            chart.xAxis.tickFormat(d3.format('.02f'));
            chart.yAxis.tickFormat(d3.format('.02f'));
            d3.select('#chart_alerts')
                .datum(nv.log(randomData(4,50)))
                .call(chart);
            nv.utils.windowResize(chart.update);
            return chart;
        });
        function randomData(groups, points) { //# groups,# points per group
            var groupnames = ['Servers', 'Databases', 'Websites', 'Network'];
            var data = [],
                shapes = ['circle'],
                random = d3.random.normal();
            for (i = 0; i < groups; i++) {
                data.push({
                    key: groupnames[i],
                    values: [],
                    slope: Math.random() - 0.01,
                    intercept: Math.random() - 0.5
                });
                for (j = 0; j < points; j++) {
                    data[i].values.push({
                        x: random(),
                        y: random(),
                        size: Math.random(),
                        shape: shapes[j % shapes.length]
                    });
                }
            }
            return data;
        }
    };
    
